{"title":"[Checkpoint] Product score by challenges","type":"vega","params":{"spec":"{

  $schema: https://vega.github.io/schema/vega-lite/v2.json
  title: Product score by challenges
  data: {
    url: {
      index: checkpoint
      body: {
        "_source": ["challenges", "title", "productScore"], 
        "query": {
          "bool": {
            "must": [
            "%dashboard_context-must_clause%"
            {
                "query_string": {
                  "query": "+docType:records +resourceType:TDP +productScore:(Inadequate* or Limited* or *Good* or Excellent*)"
                }
            }]
          }
        },
        "size": 2000
      }
    }
    format: {property: "hits.hits"}
  }

  "transform": [
    {"calculate": "datum._source.challenges", "as": "challenge"}
  ],
  "mark": "rect",
  "encoding": {
      //"row": {"field": "challenge", "type": "nominal"},
      "x": {
        "field": "_source.challenges", 
        "type": "nominal",
        "title": "Challenge"},
      "y": {
        "field": "_source.title", 
        "type": "ordinal",
        "title": "Product"},
      "color": {
        "field": "_source.productScore", 
        "type": "ordinal",
        // "scale": {
        //   "scheme": "redyellowgreen",
        //   "reverse": true
        // }
        "scale": {
        "domain": ["Inadequate: Impossible to produce or fails to meet all the objectives (not usable)","Limited: The product fails in most aspects to meet the objectives but meet some.","Good: The product meets more than 50% of the objectives specified by the challenge","Very good: The product meets more than 70% of the objectives specified by the challenge","Excellent: The product meets well the objectives specified by the challenge"],
        "range": ["#ff0000","#ff9900","#ffff99","#99ff99","#33cc33"]
        },
        "legend": { 
          "title": "Product score"
        }
      }
  }
}"},"aggs":[]}

